import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { API } from 'src/app/core/api/api-constants';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root',
})
export class BookingUserService {

  constructor(private http: HttpClient) {}

  // ðŸ”¹ Get all bookings of a user
  getBookingsByUser(userId: string): Observable<any[]> {
    return this.http.get<any[]>(`${API.bookings}/user/${userId}`);
  }

  // ðŸ”¹ Cancel booking
  cancelBooking(bookingId: string): Observable<any> {
    return this.http.put(`${API.bookings}/${bookingId}/cancel`, {});
  }
}
